import React from "react";
import Jumbotron from "../components/Jumbotron";
import { Col, Row, Container } from "../components/Grid";
import { FormBtn } from "../components/Form";
import "./Home.css";

function Home() {
    return (
        <Container fluid>
            <Row>
                <Col size="md-6">
                    <Jumbotron>
                        <h1>You Can Do This.</h1>
                        <FormBtn className="startButton">Start working out</FormBtn>
                        <FormBtn>Add an exercise</FormBtn>
                    </Jumbotron>
                </Col>
            </Row>
            <Row>
                <Col size="sm-6">
                    <FormBtn>Add an exercise</FormBtn>
                </Col>
                <Col size="sm-6">
                    <FormBtn>Start working out</FormBtn>
                </Col>
            </Row>
        </Container>
    )
}

export default Home;
